import Header from './Header'
import Footer from './Footer'

export default function Layout(props) {
    return (
        <div className="layout">
            <div className="header">
                <Header />
            </div>
            <div className="body">
              <body >
                {props.children}
              </body>
            </div>
            <div className="Footer">
                <Footer />
            </div>
            <style jsx>{`
              .header {
                  width: 100%;
                  height: 80px;
                  border: 1px solid;
              }

              .layout {
                margin: 20px;
                padding: 20px;
              }

              .body {
                border: 1px solid #DDD;
                display: flex;
                flex-direction: column;
                min-height: 100vh;
              }

              .Footer {
                width: 100%;
                height: 100px;
                background-color: red;
                color: white;
                text-align: center;
            }
            
            `}
            </style>
        </div>
    )
}
